import React from 'react';
import {Div, Group, Panel, PanelHeader, View} from '@vkontakte/vkui';
import '@vkontakte/vkui/dist/vkui.css';

class Main extends React.Component {

    render() {
        return (
            <View activePanel="Main">
                    <Group>
                        <Div>
                            Hello world
                        </Div>
                    </Group>
            </View>
        );
    }
}

export default Main;
